import BoxScoreItem from "./components/BoxScoreItem";

function App() {

  const boxscores = [
    {
      id: 'bs1',
      date: new Date(2021, 2, 28),
      opponent: 'Timberwolves',
      team: 'Miami Heat',
      player: 'Jimmy Butler',
      points: 29,
      rebounds: 9,
      assists: 5,
    },

    {
      id: 'bs2',
      date: new Date(2022, 4, 5),
      opponent: 'Warriors',
      team: 'Mavs',
      player: 'Luka Doncic',
      points: 34,
      rebounds: 7,
      assists: 12,
    },

    {
      id: 'bs3',
      date: new Date(2019, 11, 15),
      opponent: 'Hawks',
      team: 'Magic',
      player: 'JMo Bamba',
      points: 12,
      rebounds: 14,
      assists: 2,
    },

    {
      id: 'bs4',
      date: new Date(2020, 9, 28),
      opponent: 'Celtics',
      team: 'Miami Heat',
      player: 'Bam Adebeyo',
      points: 32,
      rebounds: 13,
      assists: 5,
    }
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <BoxScoreItem
        date={boxscores[0].date}
        opponent={boxscores[0].opponent}
        team={boxscores[0].team}
        player={boxscores[0].player}
        points={boxscores[0].points}
        rebounds={boxscores[0].rebounds}
        assists={boxscores[0].assists}>
      </BoxScoreItem>
      <BoxScoreItem> </BoxScoreItem>

    </div>
  );
}

export default App;
